:- dynamic multiset/0, sameMultiset/2.multiset :- sameMultiSet(o(a,o(a,emptyMultiSet)),o(_X,o(emptyMultiSet,b))).sameMultiSet(X, X).sameMultiSet(o(X, Y), o(X, Z)):-	sameMultiSet(Y, Z).sameMultiSet(o(o(X, Y), Z), U):- 	sameMultiSet(o(X, o(Y, Z)), U).sameMultiSet(U, o(o(X, Y), Z)):-	sameMultiSet(U, o(X, o(Y, Z))).sameMultiSet(o(emptyMultiSet, X), Y):-	sameMultiSet(X, Y).sameMultiSet(X, o(emptyMultiSet, Y)):-	sameMultiSet(X, Y).sameMultiSet(o(X, Y), Z):-	sameMultiSet(o(Y, X), Z).